import React from "react";
import { BrowserRouter as Router, Route, Routes, Link } from "react-router-dom";

import VegetableDetection from "./VegetableDetection";
import PacketDetection from "./PacketDetection";
import GetForecasting from "./pages/GetForecasting";
import ChefChat from "./components/ChefChatBot/ChefChat";
import WasteDetection from "./components/WasteDetection/WasteDetection";

function App() {
  return (
    <Router>
      <div>
        <nav style={navStyle}>
          <ul style={navListStyle}>
            <li><Link to="/vegetable-detection" style={linkStyle}>Vegetable Detection</Link></li>
            <li><Link to="/packet-detection" style={linkStyle}>Packet Detection</Link></li>
            <li><Link to="/get-forecasting" style={linkStyle}>Get Forecasting</Link></li>
            <li><Link to="/chef-chat" style={linkStyle}>Chef Chat</Link></li>
            <li><Link to="/waste-detection" style={linkStyle}>Waste Detection</Link></li>
            <li ><Link to="/add-seles-data" style={linkStyle}>add seles data</Link></li>
          </ul>
        </nav>

        <Routes>
          <Route path="/vegetable-detection" element={<VegetableDetection />} />
          <Route path="/packet-detection" element={<PacketDetection />} />
          <Route path="/get-forecasting" element={<GetForecasting />} />
          <Route path="/chef-chat" element={<ChefChat />} />
          <Route path="/waste-detection" element={<WasteDetection />} />
        </Routes>
      </div>
    </Router>
  );
}

const navStyle = {
  background: "linear-gradient(to right, #00b4db, #0083b0)",
  padding: "12px 24px",
  marginBottom: "20px",
  boxShadow: "0 2px 6px rgba(0,0,0,0.1)",
};

const navListStyle = {
  display: "flex",
  justifyContent: "space-around",
  alignItems: "center",
  listStyleType: "none",
  margin: 0,
  padding: 0,
};

const linkStyle = {
  color: "white",
  textDecoration: "none",
  fontWeight: "bold",
  padding: "10px 16px",
  borderRadius: "8px",
  transition: "background-color 0.3s ease",
};

const hoverStyle = `
  nav ul li a:hover {
    background-color: rgba(255, 255, 255, 0.2);
  }
`;

// Inject hover style into the document
const style = document.createElement("style");
style.innerHTML = hoverStyle;
document.head.appendChild(style);

export default App;
